class Solution(object):
    def findWords(self, board, words):
        """
        :type board: List[List[str]]
        :type words: List[str]
        :rtype: List[str]
        """
        self.board = board
        self.h = len(board)
        self.w = len(board[0])
        self.words = words
        self.d = {}
        self.d_board_count = {}
        self.countBoard()
        res = []
        for word in self.words:
            self.resetUsed()
            if not self.isPossible(word):
                continue
            findword_res = self.findWord(word)
            if findword_res is not None:
                res.append(findword_res[0])
                self.d[word] = findword_res[1]
        return list(set(res))

    def resetUsed(self):
        self.used = []
        for i in xrange(self.h):
            self.used.append([0] * self.w)

    def findWord(self, word):
        if word is None or len(word) == 0:
            return None
        i = 1
        while i < len(word):
            if self.d.get(word[:i]) is None:
                break
            i += 1
        if i > 1:
            word_pre = word[:i-1]
            word_post = word[i-1:]
            loc_pre = self.d.get(word_pre)
            if word_post == '':
                return word_pre, loc_pre
            for loc in loc_pre:
                self.used[loc[0]][loc[1]] = 1
            r, c = loc_pre[-1]
            next_res = self.findNext(r, c, word_post, word_pre)
            if next_res is not None:
                loc_post = [(r, c)] + next_res[1]
                return word, loc_pre + loc_post
        # if failed to find word using existing paths, have to start from the beginning of word
        self.resetUsed()
        letter = word[0]
        for (r, c) in self.findLetter(letter):
            if len(word) == 1:
                return word, [(r, c)]
            else:
                self.used[r][c] = 1
                self.d[letter] = [(r, c)]
                next_res = self.findNext(r, c, word[1:], letter)
                if next_res is not None:
                    loc_post = [(r, c)] + next_res[1]
                    return word, loc_post
                else:
                    self.used[r][c] = 0


    def findNext(self, r, c, word, prefix):
        if word is None or len(word) == 0:
            return None

        neighbors = self.getNeighbors(r, c)
        letter = word[0]
        for (nr, nc) in neighbors:
            if self.board[nr][nc] == letter:
                if len(word) == 1:
                    return word, [(nr, nc)]
                else:
                    self.used[nr][nc] = 1
                    if self.d.get(letter) is None:
                        self.d[letter] = [(nr, nc)]
                    if self.d.get(prefix) is not None:
                        self.d[prefix + letter] = self.d[prefix] + [(nr, nc)]
                    next_res = self.findNext(nr, nc, word[1:], prefix + letter)
                    if next_res is not None:
                        found_words, next_loc = next_res
                        return word, [(nr, nc)] + next_loc
                    else:
                        self.used[nr][nc] = 0

    def findLetter(self, letter):
        locs = []
        for r in xrange(self.h):
            for c in xrange(self.w):
                if self.board[r][c] == letter and self.used[r][c] == 0:
                    locs.append((r, c))
        return locs

    def getNeighbors(self, r, c):
        neighbors = []
        if r > 0 and self.used[r-1][c] == 0:
            neighbors.append((r-1, c))
        if c > 0 and self.used[r][c-1] == 0:
            neighbors.append((r, c-1))
        if r + 1 < self.h and self.used[r+1][c] == 0:
            neighbors.append((r+1, c))
        if c + 1 < self.w and self.used[r][c+1] == 0:
            neighbors.append((r, c+1))
        return neighbors

    # quickly filter out impossible cases, returns False is impossible
    # however, a return value of True only means it's not impossible after a quick examination,
    # it does not mean that it's possible.
    def isPossible(self, word):
        for i, char in enumerate(word):
            if self.d_board_count.get(char) is None or self.d_board_count[char] == 0:
                return False
            if self.d_board_count[char] == 1 and i + 1 < len(word):
                found = False
                r, c = self.findLetter(char)[0]
                for (nr, nc) in self.getNeighbors(r, c):
                    if self.board[nr][nc] == word[i+1]:
                        found = True
                return found
        return True

    def countBoard(self):
        for board_row in self.board:
            for char in board_row:
                if self.d_board_count.get(char) is None:
                    self.d_board_count[char] = 1
                else:
                    self.d_board_count[char] += 1

